description.text:
The predefined functions are wrappers that define the dimensions for generic functions that define the model.
E.g. <code >bearing688ZZ()</code> calls the generic <code >bearing()</code> function and passes in the dimensions for a 688ZZ bearing.
<code >//Predefined LM8UU Bearing
module bearing688ZZ()
{
    bearing(16, 8, 5);
}</code>
and the <code >bearing()</code> function takes the following arguments:
<code >bearing(outerRaceSize, innerRaceSize, thickness)</code>
Similarly, the <code >nema17()</code> function calls the generic <code >stepperMotor()</code> functions and passes the relevant dimensions.
<code >module nema14()
{
    stepperMotor(35.2, 36, 26.0, 3, 5, 24, 22, 2);
}</code>
stepperMotor() take the following arguments:
<code >stepperMotor(caseSize, caseHeight, holeSpacing, holeDiameter, shaftDiameter, shaftHeight, shaftCollarDiameter, shaftCollarThickness)</code>
The fan function works the same way. So for a 60mm fan call <code >fan60()</code> which passes the relevant dimensions to <code >fan()</code>:
<code >module fan60()
{
    fan(60,25,50,3.5);
}</code>
<code >fan()</code> takes the following dimensions.
<code >module fan(width,thickness,mountingHoleDistance,mountingHoleSize)</code>
